import React from 'react';
import './Home2.scss';

function Home2() {
  return (
    <div className="home">
      <div className="google" id="google">GOOGLE</div>
      <div className="facebook" id="facebook">FACEBOOK</div>
    </div>
  )
}

export default Home2;


